import React, { useState } from 'react';
import Timetable from './Timetable';
import './App.css';

const App = () => {
  const [selectedBranch, setSelectedBranch] = useState('CSE');

  return (
    <div className="App">
      <h1>University Timetable</h1>
      <div className="branch-selection">
        <button onClick={() => setSelectedBranch('CSE')}>CSE</button>
        <button onClick={() => setSelectedBranch('ECE')}>ECE</button>
      </div>
      <Timetable branch={selectedBranch} />
    </div>
  );
};

export default App;
